  \"Lake Andes National Wildlife Refuge Complex : Lake Andes National Wildlife Refuge,
  Karl Mundt National Wildlife Refuge, Lake Andes Wetland Management District : 1995
  Annual narrative report\",\n\t\"tracking_summary\": {\n\t\t\"total\": 7,\n\t\t\"recent\":
  1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\":
  \"2016-07-27T22:40:23.887652\",\n\t\"name\": \"lake-andes-national-wildlife-refuge-complex-lake-andes-national-wildlife-refuge-karl-mundt-b8df3\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Lake Andes
  NWR, Karl Mundt NWR, and Lake Andes WMD outlines Refuge accomplishments during the
  1995 calendar year. The report begins with a summary of the year's highlights and
  weather conditions. Land acquisition is covered. The report includes a planning
  section which discusses management planning, compliance with environmental and cultural
  resource mandates, and research and investigations. Refuge administration is outlined;
  information about personnel, youth programs, volunteer programs, funding, safety,
  and technical assistance is given. Habitat management is also covered; subjects
  include wetlands, forests, croplands, grasslands, grazing, haying, fire management,
  pest control, WPA easements, and private lands. The wildlife section of the report
  discusses endangered and threatened species, waterfowl, marsh birds and waterbirds,
  shorebirds, game mammals, fisheries resources, wildlife propagation, animal control,
  marking and bird banding, and disease control. The public uses of the Refuge described
  in this report include outdoor classrooms, interpretive programs, hunting, fishing,
  wildlife observation, and law enforcement. The equipment and facilities section
  of the report provides information about new construction, equipment replacement,
  communication systems, and computer systems. Refuge brochures are attached.\",\n\t\"license_title\":
